import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

import Read from './post/PageLoad'; 
import Post from './post/PagePost';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path="/blog/:fileName" element={<Post />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
